import React from 'react';
import { View,StyleSheet,Text } from 'react-native';

const SearchBar=()=>{
    return(
        <View style={styles.search_display}></View>
    );
};

const style=StyleSheet.create({
    search_display:{
        backgroundColor:'#foeeee'
    }
});

export default SearchBar;
